        "keystone.guide.steps0.stepTitle": "Setup Preparations",
        "keystone.guide.steps0.title1": "1. Charge a Battery pack",
        "keystone.guide.steps0.desc1": "Rechargeable pack (Keystone Pro only):",
        "keystone.guide.steps0.desc2":
          "Use the USB-C cable in the box and a charger (not included, 5V1A or 5V2A) to fully charge the rechargeable lithium battery. This normally takes around 3 hours. There is a small light indicator on the battery that would turn while charging and yellow when fully charged.\n\nNote: The Keystone Essential does not come with this rechargeable battery.",
        "keystone.guide.steps0.desc3":
          "AAA Battery pack (Both Keystone Pro & Essential):\n\nPlace 4 brand new AAA batteries into the battery case. Rechargeable batteries are more stable than normal ones.\n\n",
        "keystone.guide.steps0.title2":
          "2. Prepare A microSD card not exceeding 512GB of maximum memory capacity.",
        "keystone.guide.steps0.title3":
          "3. Place the battery pack onto your hardware wallet, then press the Power button for 3 seconds to turn on the device.",
        "keystone.guide.steps0.warning":
          "A 70% minimum charge is required to start keystone firmware upgrades.",
        "keystone.guide.steps1.stepTitle": "Step 1: Web Authentication",
        "keystone.guide.steps1.desc1":
          "Keystone's web authentication tool can verify whether your Keystone was tampered with in the manufacturing or logistics. You can also use this authentication tool to authenticate all of our firmware upgrades. Find out {more} about this web authentication tool and its security benefits.",
        "keystone.guide.steps1.desc2":
          "Scan the QR code provided from the authentication tool with your Keystone, then enter the 8 characters displayed on your Keystone after the scan into the web tool.",
