        "keystone.guide.steps2.stepTitle": "Step 2: Set a Password",
        "keystone.guide.steps2.title1":
          "1. Password Length requirement: A minimum of 10 characters.",
        "keystone.guide.steps2.title2":
          "2. The Password must include both upper-case letters, lower-case letters and at least one digit. Symbols are allowed.",
        "keystone.guide.steps2.warning":
          "If you import a recovery phrase and set up a password to sign transactions (private keys will call a password for signature), your digital assets could be stolen if your password is leaked or shared. Hence, we highly recommend setting a strong password and avoid using simple ones like names or birthdays since this would make it more difficult for hackers to guess and access your funds.",
