        "keystone.guide.steps3.title1": "Requirements:",
        "keystone.guide.steps3.title2":
          "1. A microSD card in FAT32 format with a max memory capacity of 512GB.",
        "keystone.guide.steps3.title3": "2. Keystone battery level above 70%.",
        "keystone.guide.steps3.title4": "Steps:",
        "keystone.guide.steps3.title5":
          "1. Download the latest firmware. You can choose either the multi-coin firmware or the BTC-only one based on your needs. Please check {article} for BTC-only firmware details.",
        "keystone.guide.steps3.article": "this article",
        "keystone.guide.steps3.warning":
          "Please be advised that once the device upgrades from the multi-coin firmware to the BTC-Only one, switching back to the multi-coin one is impossible.",
