        "keystone.guide.steps3.here": "here",
        "keystone.guide.steps3.tips1":
          "Tip: Check the SHA256sum of the firmware prior to updating for your security",
        "keystone.guide.steps3.title7":
          '2. Unzip the downloaded package and copy the "update.zip" file to the root directory of your microSD card.\n\n',
        "keystone.guide.steps3.title8":
          "3. Insert the microSD card into your Keystone device and press \u201cUpgrade\u201d. If your microSD card isn\u2019t recognized, it might not be in FAT32 format. If so, please format your microSD card and try again.",
