        "keystone.resources.getStarted.step.step4.sec1.title": "Requirements:",
        "keystone.resources.getStarted.step.step4.sec1.c1":
          "1. A MicroSD card in FAT32 format with a maximum memory capacity of 512GB.",
        "keystone.resources.getStarted.step.step4.sec1.c2":
          "2. Keystone battery level above 70%.",
        "keystone.resources.getStarted.step.step4.sec2.title": "Steps:",
        "keystone.resources.getStarted.step.step4.sec2.c1":
          "1. Download the latest firmware. You can choose either the multi-coin firmware or the BTC-only one based on your needs. Please read this article for BTC-only firmware details.",
        "keystone.resources.getStarted.step.step4.sec2.tip":
          "Do note that you will not be able to revert and use the Multi-Coin firmware once you install and upgrade your Keystone device with the Bitcoin-Only firmware.",
        "keystone.resources.getStarted.step.step4.sec2.multicoin":
          "Multi-Coin Firmware",
        "keystone.resources.getStarted.step.step4.sec2.bitcoin":
          "BTC-Only Firmware",
        "keystone.resources.getStarted.step.step4.sec2.c2":
          "Please download your firmware update <here>here</here> if your device is already running the BTC-only firmware.",
        "keystone.resources.getStarted.step.step4.sec2.c3":
          "Tip: For safety, do double check the SHA256sum of the firmware prior to updating your Keystone device",
        "keystone.resources.getStarted.step.step4.sec2.c4":
          '2. Unzip the downloaded package and copy the "update.zip" file to the root directory of your MicroSD card.',
        "keystone.resources.getStarted.step.step4.sec2.c5":
          "3. Insert the MicroSD card into your Keystone device and select \u201cUpgrade\u201d. If the auto-update window does not automatically pop up,  please tap the \u3010Menu\u3011icon, then\u3010Settings\u3011, then\u3010Version\u3011to update your device manually. If your MicroSD card isn\u2019t recognized, it might not be in the correct FAT32 format. If so, please format your MicroSD card and try again.",
        "keystone.resources.getStarted.step.step4.sec2.c6":
          "Having issues with upgrading your firmware?",
        "keystone.resources.getStarted.step.step5.title":
          "Step 5: Import or Create Wallet",
        "keystone.resources.getStarted.step.step5.sec1.c1":
          "Please follow the instructions on your Keystone device to create or import your wallet.",
        "keystone.resources.getStarted.step.step5.sec1.c2":
          "Please refer to <em>this tutorial</em> if you want to use Shamir Backup for your recovery phrase.",
        "keystone.resources.getStarted.step.step5.sec1.tip":
          "Be sure to write down and store your recovery phrase (seed or secret words) in secure locations. Any form of digital storage should be avoided. This includes taking photos, typing it in a mobile notebook application, or storing it in a password manager or any cloud storage services. NEVER share your recovery phrase!",
        "keystone.resources.getStarted.step.step5.next": "Next",
        "keystone.resources.getStarted.step.step6.title":
          "Step 6: Choose the proper companion app",
