        "keystone.guide.welcome.seo.keywords":
          "Cobo\u91d1\u5e93\uff0c\u786c\u4ef6\u94b1\u5305\uff1b\u6bd4\u7279\u5e01\uff1b\u4ee5\u592a\u574a\uff1b\u51b7\u94b1\u5305\uff1b\u52a9\u8bb0\u677f\uff1b\u91d1\u94a2\u5323\uff1b\u94e0\u77f3\uff1bBitcoin\uff1bEthereum\uff1bBTC\uff1bETH\uff1bKeystone\uff1b\u94e0\u77f3",
        "keystone.guide.welcome.title":
          "\u6b61\u8fce\u4f7f\u7528 Keystone \u786c\u4ef6\u9322\u5305",
        "keystone.guide.welcome.desc":
          "\u611f\u8b1d\u60a8\u9078\u64c7 Keystone \u786c\u4ef6\u9322\u5305\u3002\u5c0d\u9322\u5305\u9032\u884c\u521d\u59cb\u5316\u8a2d\u7f6e\u4ee5\u524d\uff0c\u8acb\u4ed4\u7d30\u95b1\u8b80\u4ee5\u4e0b\u8a3b\u610f\u4e8b\u9805\uff1a",
        "keystone.guide.welcome.option1":
          "\u6211\u5df2\u5145\u5206\u77e5\u66c9\uff0c\u52a9\u8a18\u8a5e\uff08Recovery Phrase\uff0cSeed \u6216\u8005 Secret Words\uff09\u4ee3\u8868\u4e86\u6211\u5c0d\u6211\u7684\u6578\u5b57\u8cc7\u7522\u7684\u6700\u7d42\u6240\u6709\u6b0a\u3002\u5982\u679c\u52a9\u8a18\u8a5e\u4e1f\u5931\u6216\u8005\u907a\u5fd8\uff0c\u6211\u5c07\u7121\u6cd5\u627e\u56de\u6211\u7684\u6578\u5b57\u8cc7\u7522\u3002",
        "keystone.guide.welcome.option2":
          "\u6211\u5df2\u5145\u5206\u77e5\u66c9\uff0c\u6211\u9700\u8981\u5c07\u52a9\u8a18\u8a5e\uff08Recovery Phrase\uff0cSeed \u6216\u8005 Secret Words\uff09\u6284\u5beb\u5099\u4efd\u4e26\u4fdd\u5b58\u5728\u591a\u500b\u5b89\u5168\u7684\u5730\u9ede\u3002\u4efb\u4f55\u6578\u5b57\u5316\u7684\u5b58\u5132\u65b9\u5f0f\u90fd\u662f\u4e0d\u5b89\u5168\u7684\uff0c\u5305\u62ec\u4f46\u4e0d\u9650\u65bc\uff0c\u5c0d\u52a9\u8a18\u8a5e\u62cd\u651d\u7167\u7247\uff0c\u5c07\u52a9\u8a18\u8a5e\u4fdd\u5b58\u5728\u624b\u6a5f\u8a18\u4e8b\u672c\uff0c\u4fdd\u5b58\u5728\u5bc6\u78bc\u7ba1\u7406\u8edf\u4ef6\u6216\u8005\u4efb\u4f55\u96f2\u5b58\u5132\u670d\u52d9\u3002",
        "keystone.guide.welcome.option3":
          "\u6211\u5df2\u5145\u5206\u77e5\u66c9\uff0c\u6211\u7d55\u4e0d\u53ef\u4ee5\u5c07\u52a9\u8a18\u8a5e\uff08Recovery Phrase\uff0cSeed \u6216\u8005 Secret Words\uff09\u5206\u4eab\u7d66\u4efb\u4f55\u4eba\u3002\u4efb\u4f55\u64c1\u6709\u6211\u7684\u52a9\u8a18\u8a5e\u7684\u4eba\u5c07\u6709\u80fd\u529b\u8f49\u79fb\u6211\u7684\u6240\u6709\u6578\u5b57\u8cc7\u7522\uff0c\u88ab\u8f49\u79fb\u7684\u8cc7\u7522\u5c07\u7121\u6cd5\u88ab\u627e\u56de\u3002\u5982\u679c\u4efb\u4f55\u4eba\u6216\u8005\u670d\u52d9\uff08\u5305\u62ec\u4f46\u4e0d\u9650\u65bc\u5ba2\u670d\u4eba\u54e1\uff0c\u5728\u7dda\u8868\u55ae\u6216\u8005\u7db2\u7ad9\uff0c\u8abf\u7814\u90f5\u4ef6\uff09\u5982\u679c\u5411\u6211\u7d22\u53d6\u6211\u7684\u52a9\u8a18\u8a5e\uff0c\u9019\u4e9b\u4eba\u4e00\u5b9a\u662f\u6b3a\u8a50\u5206\u5b50\u3002Keystone \u5b98\u65b9\u4e5f\u4e0d\u6703\u4ee5\u4efb\u4f55\u5f62\u5f0f\u5411\u6211\u7d22\u53d6\u6211\u7684\u52a9\u8a18\u8a5e\u3002",
        "keystone.guide.steps0.stepTitle": "\u521d\u59cb\u5316\u6e96\u5099",
        "keystone.guide.steps0.title1": "1. \u5145\u96fb",
        "keystone.guide.steps0.desc1":
          "\u92f0\u96fb\u6c60\uff08\u50c5\u9650\u65bc Keystone \u5c08\u696d\u7248\uff09\uff1a",
        "keystone.guide.steps0.desc2":
          "\u4f7f\u7528\u7522\u54c1\u5305\u88dd\u76d2\u4e2d\u7684 USB Type-C \u6578\u64da\u7dda\uff0c\u4ee5\u53ca\u5145\u96fb\u5668\uff08\u4e0d\u5305\u542b\u5728\u5305\u88dd\u4e2d\uff0c\u5fc5\u9808\u70ba5V1A \u6216 5V2A \u96fb\u58d3\uff09\u70ba\u92f0\u96fb\u6c60\u5145\u96fb\uff0c\u5927\u7d04 3 \u500b\u5c0f\u6642\u53ef\u5145\u6eff\u96fb\u3002\u92f0\u96fb\u6c60\u5e95\u90e8\u6709\u6307\u793a\u71c8\uff0c\u5145\u96fb\u6642\u6307\u793a\u71c8\u4eae\u8d77\uff0c\u7576\u6307\u793a\u71c8\u8b8a\u9ec3\u6642\uff0c\u8868\u793a\u92f0\u96fb\u6c60\u5df2\u6eff\u96fb\u3002\n\n\u8acb\u6ce8\u610f\uff1aKeystone \u6a19\u6e96\u7248\u4e0d\u9644\u914d\u6b64\u92f0\u96fb\u6c60\u677f\u3002",
        "keystone.guide.steps0.desc3":
          "\u4f7f\u7528 AAA \u96fb\u6c60\u7d44\u4f9b\u96fb\uff08Keystone \u5c08\u696d\u7248\u548c\u6a19\u6e96\u7248\u5747\u9644\u914d\uff09\uff1a\n\n\u5c07 4 \u7bc0\u5168\u65b0\u7684 AAA \u96fb\u6c60\u653e\u5165\u96fb\u6c60\u7d44\u76d2\u4e2d\u3002\u5efa\u8b70\u4f7f\u7528\u53ef\u5145\u96fb\u96fb\u6c60\uff0c\u5b83\u6bd4\u666e\u901a\u96fb\u6c60\u66f4\u7a69\u5b9a\u3002",
        "keystone.guide.steps0.title2":
          "2. \u6e96\u5099\u4e00\u5f35\u5bb9\u91cf\u4e0d\u8d85\u904e 512GB \u7684 microSD \u5361\uff08\u5982\u679c\u96fb\u8166\u4e0d\u652f\u6301\u76f4\u63a5\u63d2\u5165 microSD \u5361\uff0c\u5247\u9084\u9700\u6e96\u5099 microSD \u5361\u8b80\u5361\u5668\uff09\u3002",
        "keystone.guide.steps0.title3":
          "3. \u786c\u4ef6\u9322\u5305\u88dd\u4e0a\u96fb\u6c60\u7d44\u5f8c\uff0c\u9577\u6309\u96fb\u6e90\u9375 3 \u79d2\u9418\u5c07\u8a2d\u5099\u958b\u6a5f\u3002",
        "keystone.guide.steps0.warning":
          "\u9032\u884c\u56fa\u4ef6\u5347\u7d1a\u64cd\u4f5c\u6642\uff0c\u9700\u8981 Keystone \u9322\u5305\u4fdd\u6301\u96fb\u6c60\u96fb\u91cf\u5728 70% \u4ee5\u4e0a\u3002",
        "keystone.guide.steps1.stepTitle":
          "\u7b2c\u4e00\u6b65\uff1a\u5b98\u7db2\u9a57\u8b49",
        "keystone.guide.steps1.desc1":
          "Keystone \u7684\u5b98\u7db2\u9a57\u8b49\u5de5\u5177\u53ef\u4ee5\u9a57\u8b49\u60a8\u7684 Keystone \u786c\u4ef6\u9322\u5305\u662f\u5426\u5728\u751f\u7522\u6216\u7269\u6d41\u904e\u7a0b\u4e2d\u88ab\u7be1\u6539\u3002 \u60a8\u9084\u53ef\u4ee5\u4f7f\u7528\u6b64\u9a57\u8b49\u5de5\u5177\u4f86\u9a57\u8b49\u6211\u5011\u6240\u6709\u7684\u56fa\u4ef6\u5347\u7d1a\u5305\u3002\u9ede\u64ca{more}\u77ad\u89e3\u6709\u95dc\u6b64\u5b98\u7db2\u9a57\u8b49\u5de5\u5177\u53ca\u5176\u5b89\u5168\u512a\u52e2\u7684\u66f4\u591a\u8cc7\u8a0a\u3002",
