        "keystone.guide.steps3.title5":
          "1. \u5c07 microSD \u5361\u63d2\u5165\u96fb\u8166\uff0c\u4e0b\u8f09\u6700\u65b0\u7684\u56fa\u4ef6\u5347\u7d1a\u5305\u3002\u7528\u6236\u53ef\u6839\u64da\u5be6\u969b\u9700\u6c42\u9078\u64c7\u591a\u5e63\u7a2e\u56fa\u4ef6\u6216 BTC \u55ae\u5e63\u7a2e\u56fa\u4ef6\u3002 \u77ad\u89e3\u66f4\u591a\u95dc\u65bc BTC \u55ae\u5e63\u7a2e\u56fa\u4ef6\u7684\u8a73\u7d30\u8cc7\u8a0a\uff0c\u8acb\u9ede\u64ca{article}\u67e5\u770b\u3002",
        "keystone.guide.steps3.article": "\u6b64\u8655",
