        "keystone.guide.steps3.title8":
          "3. \u5c07 microSD \u5361\u63d2\u5165 Keystone \u8a2d\u5099\uff0c\u7136\u5f8c\u9ede\u64ca \u201c\u7acb\u5373\u66f4\u65b0\u201d\u3002 \u5982\u679c\u60a8\u7684 microSD \u5361\u672a\u88ab\u8b58\u5225\uff0c\u5247\u5b83\u53ef\u80fd\u4e0d\u662f FAT32 \u683c\u5f0f\u3002 \u9019\u7a2e\u60c5\u6cc1\u4e0b\uff0c\u8acb\u683c\u5f0f\u5316\u60a8\u7684 microSD \u5361\u4e26\u91cd\u8a66\u3002",
